import Header from "../Header"
const UserProfile = () => {
  const userName = localStorage.getItem("username")
  const UP = {userName}
  console.log(UP)
  return (
      <>
      <Header/>
      <div className="profile-section">
      <div className="profile-container">
         <h1 className="profile-heading">{UP}</h1>

      </div>
      </div>
   </>
  )
}
export default UserProfile
